import React from "react";
import {
  Input,
  Select,
  MenuItem,
  Button,
  Grid,
  Typography,
} from "@material-ui/core";
import { useForm, FormProvider, Controller } from "react-hook-form";
function AddressForm() {
  const { control, handleSubmit } = useForm({
    defaultValues: {
      firstName: "",
      select: {},
    },
  });
  return (
    <>
      <Typography variant="h6" gutterBottom>
        Shipping Address
      </Typography>
      <form onSubmit={handleSubmit}>
        <Grid container spacing={3}>
          <Grid item xs={12} sm={6}>
            <Controller
              required
              name="firstName"
              label="First Name"
              control={control}
              render={({ field }) => <Input {...field} />}
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <Controller
              required
              name="firstName"
              label="First Name"
              control={control}
              render={({ field }) => <Input {...field} />}
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <Controller
              required
              name="firstName"
              label="First Name"
              control={control}
              render={({ field }) => <Input {...field} />}
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <Controller
              required
              name="firstName"
              label="First Name"
              control={control}
              render={({ field }) => <Input {...field} />}
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <Controller
              required
              name="firstName"
              label="First Name"
              placeholder='First Name'
              control={control}
              render={({ field }) => <Input {...field} />}
            />
          </Grid>
          <Grid item xs={12} sm={6}>
            <Controller
              required
              name=""
              label="First Name"
              control={control}
              render={({ field }) => <Input {...field} />}
            />
          </Grid> 
        </Grid>
      </form>
    </>
  );
}

export default AddressForm;
